//-----------------KNOWLEDEBASE FKT

function mergeAKlists(){
    let conflict1 = 0;
    let keykonf1 = [];
    for( Aabk in MRL ){
        if( !abkAW[ Aabk ] ){
            abkAW[ Aabk ] = MRL[ Aabk ];
        } else {
            conflict1 += 1;
            keykonf1.push( Aabk );
        }
    }
    let conflict2 = 0;
    let keykonf2 = [];
    for( Aabk in LDM ){
        if( !abkAW[Aabk] ){
            abkAW[Aabk] = LDM[Aabk];
        } else {
            conflict2 += 1;
            keykonf2.push( Aabk );
        }
    }
    
    console.log("Len", Object.keys(abkAW).length,  "MRL", Object.keys(MRL).length, "Konflikte", conflict1,  "LDM", Object.keys(LDM).length, "Konflikte", conflict2 );
    console.log(keykonf1, keykonf2);
    console.log("knowledgebase merged!");
}

function normAKlists(){
    MRL = normarrayk( MRL ) ;
    for( let abk in MRL ){
        MRL[ abk ][1] = normarrayk( MRL[ abk ][1] );
    }

    LDM = normarrayk( LDM ) ;
    for( let abk in LDM ){
        LDM[ abk ][1] = normarrayk( LDM[ abk ][1] );
    }

    console.log("knowledgebase normed!");
}



//call on load
normAKlists( );
mergeAKlists( );
